import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Configure.css";

function Configure() {
  const [sourceType, setSourceType] = useState("folder");
  const [sourcePath, setSourcePath] = useState("");
  const [fileFilters, setFileFilters] = useState("");
  const [trigger, setTrigger] = useState("");

  const [targetType, setTargetType] = useState("folder");
  const [targetPath, setTargetPath] = useState("");
  const [additionalPaths, setAdditionalPaths] = useState("");
  const [transformation, setTransformation] = useState("");
  const [routingMode, setRoutingMode] = useState("");

  const navigate = useNavigate();

  const handleSubmit = (event) => {
    event.preventDefault();
    const configuration = {
      source: {
        type: sourceType,
        path: sourcePath,
        filters: fileFilters.split(","),
        trigger,
      },
      target: {
        type: targetType,
        path: targetPath,
        additionalPaths: additionalPaths.split(","),
        transformation,
        routingMode,
      },
    };

    // Navigate to the Review page with configuration data
    navigate("/review", { state: configuration });
  };

  return (
    <div className="configure-container">
      <h1>Configure Your Workflow</h1>
      <form onSubmit={handleSubmit}>
        <div className="form-section">
          <h2>Source Configuration</h2>
          <label>Type:</label>
          <select value={sourceType} onChange={(e) => setSourceType(e.target.value)}>
            <option value="folder">Folder</option>
            <option value="activemq">ActiveMQ</option>
          </select>
          <label>Path/Queue Name:</label>
          <input
            type="text"
            value={sourcePath}
            onChange={(e) => setSourcePath(e.target.value)}
          />
          <label>File Filters (comma-separated):</label>
          <input
            type="text"
            value={fileFilters}
            onChange={(e) => setFileFilters(e.target.value)}
          />
          <label>Trigger (Optional):</label>
          <input
            type="text"
            value={trigger}
            onChange={(e) => setTrigger(e.target.value)}
          />
        </div>

        <div className="form-section">
          <h2>Target Configuration</h2>
          <label>Type:</label>
          <select value={targetType} onChange={(e) => setTargetType(e.target.value)}>
            <option value="folder">Folder</option>
            <option value="activemq">ActiveMQ</option>
          </select>
          <label>Path/Queue Name:</label>
          <input
            type="text"
            value={targetPath}
            onChange={(e) => setTargetPath(e.target.value)}
          />
          <label>Additional Paths (comma-separated):</label>
          <input
            type="text"
            value={additionalPaths}
            onChange={(e) => setAdditionalPaths(e.target.value)}
          />
          <label>Transformation (Optional):</label>
          <input
            type="text"
            value={transformation}
            onChange={(e) => setTransformation(e.target.value)}
          />
          <label>Routing Mode (Optional):</label>
          <input
            type="text"
            value={routingMode}
            onChange={(e) => setRoutingMode(e.target.value)}
          />
        </div>

        <button type="submit">Review Configuration</button>
      </form>
    </div>
  );
}

export default Configure;
